import s from './Info.module.css';

const Info = () => {
    return (
            <div className={s.info}>
                <div className={s.photo}>
                    <img src='/img/sova.jpeg'/>
                </div>

                <div className={s.photoInfo}>
                    <h3>Dmitry K.</h3>
                        <p>
                            Date of Birth: 2 January<br/>
                            City: Minsk<br/>
                            Education: BSU`11<br/>
                            Web Site: htpp//..
                        </p>
                    </div>
                </div>
    )
}

export default Info;
